import Header from "../common/Header";

const SettingsPage = () => {
  return (
    <>
      <Header pageTitle={"Settings Page"} />
      <div>
        <h2 className="text-center text-2xl font-bold py-4 bg-red-900 text-white">
          Settings
        </h2>
        {/* Content for Settings Page */}
      </div>
    </>
  );
};

export default SettingsPage;
